import React from 'react';
import Map from './Map';
import Toolbox from './Toolbox';

let x,y;
class App extends React.Component {

    area = (xCoor,yCoor) => {
        x = xCoor, yCoor;
    }


    render() {
        return (
            <div className="row">
                <div className="col-6">
                    <Map 
                    x = {this.x}
                    y = {this.y}
                    />
                </div>
                <div className="col-6">
                    <Toolbox area={this.area} />
                </div>
            </div>
        );
    }

};
export default App;
